import { View, Text } from "react-native";

export default function CharacterSelectScreen() {
	useEffect(() => {
		effect;
		return () => {
			cleanup;
		};
	}, [input]);

	return (
		<View style={styles.main}>
			<Text></Text>
		</View>
	);
}

const styles = StyleSheet.create({
	main: {
		flex: 1,
		width: "100%",
		height: "100%",
	},
	container: {
		paddingTop: 60,
		flex: 1,
		flexDirection: "column",
		backgroundColor: "#404040",
		alignItems: "center",
		justifyContent: "space-around",
		width: "100%",
		height: "100%",
	},
	statContainer: {
		flex: 1,
		flexWrap: "wrap",
		flexDirection: "row",
		justifyContent: "space-evenly",
		alignItems: "center",
	},
	buttonContainer: {
		flex: 1,
	},
